import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import NavBar from "./Components/Navbar";
import Home from "./Components/Home";
import Footer from "./Components/Footer";

const App = () => {
  return (
    <>
      <Router>
        <div className="App">
          <Switch>
            <Route path="*">
              <NavBar />
              <Switch>
                <Route exact path="/">
                  <Home />
                </Route>
              </Switch>
              <Footer />
            </Route>
          </Switch>
        </div>
      </Router>
    </>
  );
};

export default App;
